import React from 'react'

// Style
import {Wrapper, Context} from './Menu.style'


const Menu = () => {
    return (
        <Wrapper className="container" >
            <Context className="container">
                <ul>
                    <li></li>
                </ul>
            </Context>
        </Wrapper>
    )
}

export default Menu
